function loginUser() {  

  

  const name = document.getElementById("name").value.trim();  

  

  const phone = document.getElementById("phone").value.trim();  

  

  if (!name || !phone) {  

  

    alert("Please enter both name and phone number.");  

  

    return;  

  

  }  

  

  document.getElementById("loginBox").style.display = "none";  

  

  document.getElementById("menuSection").style.display = "block";  

  

  showCategories();  

  

}  

  

   

  

function showCategories() {  

  

  const container = document.getElementById("categories");  

  

  container.innerHTML = "";  

  

  categories.forEach((cat, index) => {  

  

    const div = document.createElement("div");  

  

    div.className = "category";  

  

    div.innerHTML = `<button onclick="showItems(${index})">${cat.name}</button>`;  

  

    container.appendChild(div);  

  

  });  

  

}  

  

   

  

function showItems(index) {  

  

  const itemContainer = document.getElementById("items");  

  

  itemContainer.innerHTML = "";  

  

   

  

  const items = categories[index].items;  

  

  const filteredItems = vegOnlyActive  

  

    ? items.filter(item => item.type === "veg" || item.type === "both")  

  

    : items;  

  

   

  

  filteredItems.forEach((item, i) => {  

  

    const price = Math.floor(Math.random() * 100) + 100;  

  

    const typeIcon = item.type === "veg" ? "" : item.type === "nonveg" ? "" : "";  

  

   

  

    const itemDiv = document.createElement("div");  

  

    itemDiv.className = "item-card";  

  

    itemDiv.style.animationDelay = `${i * 100}ms`;  

  

    itemDiv.innerHTML = `  

  

      <img src="${item.image}" alt="${item.name}"/>  

  

      <h3>${item.name} ${typeIcon}</h3>  

  

      <p>Price: ${price}</p>  

  

      <button onclick="addToCart('${item.name}', ${price})">Add to Cart</button>  

  

      <button onclick="addToFavorites('${item.name}', '${item.image}')"></button>  

  

    `;  

  

    itemContainer.appendChild(itemDiv);  

  

  });  

  

}  

  

   

  

function addToCart(itemName, price) {  

  

  cartCount++;  

  

  cartItems.push({ itemName, price });  

  

  document.getElementById("cartCount").innerText = cartCount;  

  

  document.getElementById("cartCountFloat").innerText = cartCount;  

  

  updateCartSidebar();  

  

  showToast("Added to cart!");  

  

   

  

  const cartBtn = document.getElementById("cartFloatBtn");  

  

  cartBtn.classList.add("pulse");  

  

  setTimeout(() => cartBtn.classList.remove("pulse"), 300);  

  

}  

  

   

  

function showToast(message) {  

  

  const toast = document.getElementById("toast");  

  

  toast.innerText = message;  

  

  toast.classList.add("show");  

  

  setTimeout(() => toast.classList.remove("show"), 2000);  

  

}  

  

   

  

function seeCart() {  

  

  const modal = document.getElementById("cartModal");  

  

  const detailBox = document.getElementById("cartDetails");  

  

  if (cartItems.length === 0) {  

  

    detailBox.innerHTML = "<p>Your cart is empty!</p>";  

  

  } else {  

  

    let html = "<ul>";  

  

    cartItems.forEach((item, i) => {  

  

      html += `<li>${i + 1}. ${item.itemName} - ${item.price}</li>`;  

  

    });  

  

    html += "</ul>";  

  

    detailBox.innerHTML = html;  

  

  }  

  

  modal.style.display = "block";  

  

}  

  

   

  

function closeCart() {  

  

  document.getElementById("cartModal").style.display = "none";  

  

}  

  

   

  

function toggleCartSidebar() {  

  

  document.getElementById("cartSidebar").classList.toggle("open");  

  

  updateCartSidebar();  

  

}  

  

   

  

function updateCartSidebar() {  

  

  const sidebar = document.getElementById("cartSidebarItems");  

  

  if (cartItems.length === 0) {  

  

    sidebar.innerHTML = "<p>Your cart is empty!</p>";  

  

  } else {  

  

    let html = "<ul>";  

  

    cartItems.forEach((item, i) => {  

  

      html += `<li>${i + 1}. ${item.itemName} - ${item.price}</li>`;  

  

    });  

  

    html += "</ul>";  

  

    sidebar.innerHTML = html;  

  

  }  

  

  document.getElementById("cartCountFloat").innerText = cartItems.length;  

  

}  

  

   

  

function generateBillPage() {  

  

  const name = document.getElementById("name").value.trim();  

  

  const phone = document.getElementById("phone").value.trim();  

  

   

  

  if (cartItems.length === 0) {  

  

    alert("Your cart is empty!");  

  

    return;  

  

  }  

  

   

  

  const now = new Date();  

  

  const dateStr = now.toLocaleDateString();  

  

  const timeStr = now.toLocaleTimeString();  

  

   

  

  let total = 0;  

  

  let itemsHTML = "";  

  

  cartItems.forEach((item, i) => {  

  

    itemsHTML += `<tr><td>${i + 1}</td><td>${item.itemName}</td><td>${item.price}</td></tr>`;  

  

    total += item.price;  

  

  });  

  

   

  

  const billHTML = `  

  

    <html>  

  

    <head>  

  

      <title>La Tavola - Your Bill</title>  

  

      <style>  

  

        body { font-family: 'Georgia', serif; background: #fffaf0; color: #333; padding: 40px; }  

  

        .bill-box { max-width: 600px; margin: auto; border: 2px dashed #333; padding: 20px 30px; background-color: #fff; }  

  

        h1 { font-family: 'Pacifico', cursive; color: #a0522d; text-align: center; }  

  

        table { width: 100%; border-collapse: collapse; margin-top: 20px; }  

  

        td, th { padding: 10px; border-bottom: 1px solid #ccc; }  

  

        .total { text-align: right; margin-top: 10px; font-weight: bold; }  

  

        .details { margin-top: 20px; font-size: 0.95rem; line-height: 1.4; }  

  

        .barcode { margin-top: 30px; text-align: center; }  

  

        .barcode img { height: 50px; }  

  

        .footer-msg { text-align: center; margin-top: 20px; font-style: italic; }  

  

      </style>  

  

    </head>  

  

    <body>  

  

      <div class="bill-box">  

  

        <h1>La Tavola</h1>  

  

        <div class="details">  

  

          <strong>Name:</strong> ${name}<br/>  

  

          <strong>Phone:</strong> ${phone}<br/>  

  

          <strong>Date:</strong> ${dateStr}<br/>  

  

          <strong>Time:</strong> ${timeStr}  

  

        </div>  

  

        <table>  

  

          <thead><tr><th>#</th><th>Item</th><th>Price</th></tr></thead>  

  

          <tbody>${itemsHTML}</tbody>  

  

        </table>  

  

        <div class="total">Total Amount: ${total}</div>  

  

        <div class="barcode">  

  

          <img src="https://api.qrserver.com/v1/create-qr-code/?data=Thank%20You%20for%20Dining%20at%20La%20Tavola!&size=150x150" alt="QR Code" />  

  

        </div>  

  

        <div class="footer-msg">Thank you for dining with us. Buon Appetito! </div>  

  

      </div>  

  

    </body>  

  

    </html>  

  

  `;  

  

   

  

  const win = window.open("", "_blank");  

  

  win.document.write(billHTML);  

  

  win.document.close();  

  

   

  

  showFeedbackModal();  

  

}  

  

   

  

function addToFavorites(name, image) {  

  

  const favs = JSON.parse(localStorage.getItem("favorites") || "[]");  

  

  favs.push({ name, image });  

  

  localStorage.setItem("favorites", JSON.stringify(favs));  

  

  showToast(`${name} added to favorites `);  

  

}  

  

   

  

function showFeedbackModal() {  

  

  document.getElementById("feedbackModal").style.display = "block";  

  

}  

  

function closeFeedback() {  

  

  document.getElementById("feedbackModal").style.display = "none";  

  

}  

  

function submitFeedback() {  

  

  closeFeedback();  

  

  showToast("Grazie! Your feedback was submitted ");  

  

}  

  

   

  

function toggleDarkMode() {  

  

  document.body.classList.toggle("dark");  

  

}  

  

   

  

function toggleVegMode(button) {  

  

  vegOnlyActive = !vegOnlyActive;  

  

  button.classList.toggle("active", vegOnlyActive);  

  

  showCategories();  

  

}  

  

 